function HomeNewProduct() {
    return (
        <>
        <div className="home-product-cards-container">
            {ProductCardsData.map((d, i) => (

                    <div className="home-new-product-card-block">
                        <div className="new-product-image">
                            <img src={d.image} alt="" />
                        </div>
                    </div>

            ))}
        </div>
        </>
    )
}

export default HomeNewProduct;
